#include "main.h"int sorting_algorithms::main(){    int amount {10};    std::vector<int> vector_list;    unsigned seed = time(nullptr);    std::default_random_engine generator(seed);    std::uniform_int_distribution distribution(1, amount);    vector_list.reserve(amount);    for (int i = 0; i < amount; ++i)    {        vector_list.push_back(distribution(generator));    }    return 0;}